import React from 'react';

function Membership() {
  return (
    <section className="membership-section" style={{ padding: '2rem', maxWidth: '800px', margin: '0 auto' }}>
      <h2>Membership</h2>
      <p>Welcome to the Codeunia Membership page! Here you can learn about the benefits of becoming a member and sign up to join our vibrant tech community.</p>
      <ul>
        <li>Access to exclusive workshops and hackathons</li>
        <li>Mentorship from industry experts</li>
        <li>Networking opportunities with peers and professionals</li>
        <li>Early access to new projects and resources</li>
      </ul>
      <p>To become a member, please fill out the membership form below (coming soon) or contact us for more information.</p>
    </section>
  );
}

export default Membership;
